      /*border-right: 0px !important;*/
      outline: 0px !important;
    }

    .form-control:not(select) {
      padding: 1.2rem 0.5rem;
    }

    select.form-control {
      height: 42px;
      padding-left: 0.5rem;
    }

    option,
    .form-control::placeholder {
      color: #ccc;
      font-weight: bold;
      font-size: 0.9rem;
    }

    option {
      color: #000000;
      font-weight: bold;
      font-size: 1rem;
    }

    .form-control:focus {
      box-shadow: none;
    }
  </style>
